import React, {useState} from 'react';
import * as S from './styled';
import useGithub from '../../Hooks/github-hooks';

const Header = () => {
    const style = theme => ({
        principal:{
            color: '#12824C',
        }
    });

    const {getUser} = useGithub();
    const [usernameForSearch, setUsernameForSearch] = useState();

    const submitGetUser = () => {
        if (!usernameForSearch) return;
        return getUser(usernameForSearch);
    }

    return(
        <header>
            <S.Wrapper>
                <S.sTextField InputProps={{ className: style.principal}}  type="text" placeholder="Enter the username" id="outlined-basic" label="Username" variant="outlined"
                onChange={(event) => setUsernameForSearch(event.target.value)}/>
                <S.sButton style={{backgroundColor: '#12824C', color: '#FFFFFF'}} variant="contained" onClick={submitGetUser}>Search</S.sButton>
            </S.Wrapper>
        </header>
    );
};

export default Header;
